var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro thumb test object.
 * @param {Object} [props] Initializes a UIAPro Thumb test object using the supplied property bag.
 * @returns {Thumb} the description object that was initialized.
 * @class Thumb
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function Thumb(props) {
    var thumbDesc = new UiObjectBaseDescription("Thumb");

    thumbDesc._defineByPropertyBag(props);
    return thumbDesc;
}

/**
 * A UIAPro thumb.
 * @constructor
 * @class ThumbTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function ThumbTO(session, description) {
    description = description || Thumb();
    var thumbTO = new UiObjectBaseTO("UIAProThumb", session, description);

    return thumbTO;
}

module.exports.ThumbTO = ThumbTO;
module.exports.Thumb = Thumb;